export class Muscle extends Component{
    constructor(props) {
        super(props);
        this.state = {
            muscles:[]
        }
    }
    render(){
        return(
            <div>
                <table className="table table-striped">
                    <thead>
                    <tr>
                        <th>
                            MuscleName
                        </th>
                        <th>
                            MuscleCategoryId
                        </th>
                    </tr>
                    </thead>
                    <tbody>
                    
                    </tbody>
                </table>
            </div>
        )
    }
}
